import React from 'react';
import './stats.css';
export default function Stats() {
  return (
    <div className="stats-div">
      <div className="show-numbers">
        <div className="stats-data">
          <h1>$125+</h1>
          <h6>Avg Annual Income</h6>
        </div>
        <div className="stats-data">
          <h1>3X</h1>
          <h6>Growth Rate</h6>
        </div>
      </div>
      <div className="stats-details">hello</div>
    </div>
  );
}
